func QuickSort2(nums []int) {
	sort.Ints(nums)
}

func QuickSort(nums []int) {
	size := len(nums)
	if size < 2 {
		return
	}
	l, move, r := 0, 1, size-1
	tmp := nums[0]
	for move <= r {
		if nums[move] < tmp {
			nums[l] = nums[move]
			nums[move] = tmp
			l++
			move++
		} else if nums[move] == tmp {
			move++
		} else {
			nums[r], nums[move] = nums[move], nums[r]
			r--
		}
	}
	QuickSort(nums[:l])
	QuickSort(nums[r+1:])
}

